column101:
Mimo pewnych cech, które osobiście mi się nie podobają, to jednak lubię moją Uczelnię. Lubię ludzi, którzy tam uczęszczają. Lubię nauczycieli akademickich. Lubię kochane panie z sekretariatu.

Uważam, że atmosfera na Uczelni jest bardzo nietypowa względem innych Uczelni (*na plus), gdyż widać, że UIK zależy na studentach - porównując przede wszystkich do Uczelni, gdzie o jedno miejsce walczy paręnaście osób, np. UJ, UJCM, UEK, a nawet i UKEN.

Mimo iż nie jest dużo studentów w murach UIK, to tworzymy, myślę, że całkiem zgrany "zespół" :).

Ostatnią rzeczą, która myślę, że poprawiłaby ilość studentów na UIK i zainteresowanie Uczelnią, jest:
- promocja Uczelni (Facebook, Instagram, TikTok itp.);
- nowe kierunki (tak, aby każdy mógł coś wybrać);
